export function Initialize()
{
    //Left Speaker
device.createSubdevice("Mamba"); 
// Parent Device + Sub device Name + Ports
device.setSubdeviceName("Mamba",`${Razer_Mamba.displayName}`);
device.setSubdeviceImage("Mamba", Razer_Mamba.image);
device.setSubdeviceSize("Mamba",Razer_Mamba.width,Razer_Mamba.height);
device.setSubdeviceLeds("Mamba",
    Razer_Mamba.LedNames,
    Razer_Mamba.positioning)
}

function SendPacket(shutdown = false)
{
    var packet = [];     
    packet[0] = 0x00;
    packet[1] = 0x00;
    packet[2] = 0x1F;
    packet[3] = 0x00;
    packet[4] = 0x00;
    packet[5] = 0x00;
    packet[6] = 0x3E;
    packet[7] = 0x0F;
    packet[8] = 0x03;
    packet[11] = 0;
    packet[13] = 0x12;

    //Mouse
    for(var iIdx = 0; iIdx < 2; iIdx++){

        var iPxX = Razer_Mamba.positioning[iIdx][0];
        var iPxY = Razer_Mamba.positioning[iIdx][1];
        var col;
        if(shutdown){
            col = hexToRgb(shutdownColor)
        }else if (LightingMode == "Forced") {
            col = hexToRgb(forcedColor)
        }else{
            col = device.subdeviceColor("Mamba",iPxX, iPxY);
        }    

        var iLedIdx = (iIdx*3) + 14;
        packet[iLedIdx] = col[0];
        packet[iLedIdx+1] = col[1];
        packet[iLedIdx+2] = col[2];
    }
//MousePad
    for(var iIdx = 0; iIdx < vLedPositions.length; iIdx++){

        var iPxX = vLedPositions[iIdx][0];
        var iPxY = vLedPositions[iIdx][1];
        var col;
        if(shutdown){
            col = hexToRgb(shutdownColor)
        }else if (LightingMode == "Forced") {
            col = hexToRgb(forcedColor)
        }else{
            col = device.color(iPxX, iPxY);
        }    

        var iLedIdx = (iIdx*3) + 20;
        packet[iLedIdx] = col[0];
        packet[iLedIdx+1] = col[1];
        packet[iLedIdx+2] = col[2];
    }

    packet[89] = CalculateCrc(packet);

    device.send_report(packet, 91);
    device.pause(1); // We need a pause here (between packets), otherwise the ornata can't keep up.
    device.log(packet)
}


function Apply()
{
    var packet = []; //new Array(91).fill(0);
    packet[0] = 0x00;
    packet[1] = 0x00;
    packet[2] = 0x3F;
    packet[3] = 0x00;
    packet[4] = 0x00;
    packet[5] = 0x00;
    packet[6] = 0x0C;
    packet[7] = 0x0F;
    packet[8] = 0x02;
    packet[11] = 0x08;
    
    packet[89] = CalculateCrc(packet);

    device.send_report(packet, 91);
}


export function Render()
{    
    SendPacket();

    
}


